import React from 'react';
import apedad from '../images/apedad.png';



const About = () => {
    return (
        <div>
            <div className='flex flex-column'>
                 <h1> Hello world</h1>
                 <img id="ape-dad" alt="Contact Me" title="Contact Me" className="apeepic" src={apedad}></img>

            </div>
        </div>
    )
}



export default About;
